import React from  "react";
import image from "../../image.png";

const User =()=>{
    return(
        <React.Fragment>
            <div className="user">
                <div className="image">
                    <img src={image} alt=""/>
                </div>
                <div className="user-info">
                    <h3>Name of the user</h3>
                    <small>ID34j</small>
                    <a href="">View Profile</a>
                </div>
            </div>


        </React.Fragment>

    );

};


export default User;
